            <Form.Control
              type="text"
              placeholder="Enter start location"
              value={startLocation}
              onChange={(e) => setStartLocation(e.target.value)}
            />
          </Col>
        </Form.Group>

        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={2}>
            Pickup Location:
          </Form.Label>
          <Col sm={10}>
            <Form.Control
